  function _calculateFloatPerSecondExposed(
    uint32 marketIndex,
    uint256 longPrice,
    uint256 shortPrice,
    uint256 longValue,
    uint256 shortValue
  ) external view returns (uint256 longFloatPerSecond, uint256 shortFloatPerSecond) {
